import React from "react";

export default function Section({ title, body, dark, id }) {
  return (
    <div className={"section" + (dark ? " section-dark" : "")}>
      <div className="section-content" id={id}>
        <h1>{title}</h1>
        <div>{body}</div>
      </div>
    </div>
  );
}
